datab = [{},{"Attribute Name":{"colspan":"1","rowspan":"1","text":"Ion Beam Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,03A2)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of setup and/or treatment beams for current RT Ion Plan. One or more Items shall be included in this Sequence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Beam Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00C0)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification number of the Beam. The value of Beam Number (300A,00C0) shall be unique within the RT Ion Plan in which it is created. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Beam Name"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00C2)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"User-defined name for Beam. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Beam Description"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00C3)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User-defined description for Beam. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Beam Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00C4)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Motion characteristic of Beam.  Enumerated Values:  STATIC  all beam parameters remain unchanged during delivery    DYNAMIC  one or more beam parameters changes during delivery"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Radiation Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00C6)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Particle type of Beam.  Defined Terms:  PHOTON      PROTON      ION"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Radiation Mass Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0302)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Mass number of radiation. Required if Radiation Type (300A,00C6) is ION"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Radiation Atomic Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0304)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Atomic number of radiation. Required if Radiation Type (300A,00C6) is ION"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Radiation Charge State"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0306)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Charge state of radiation. Required if Radiation Type (300A,00C6) is ION"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Scan Mode"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0308)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"The method of beam scanning to be used during treatment.  Defined Terms:  NONE  No beam scanning is performed.    UNIFORM  Between control points, the beam is scanned to create a uniform lateral fluence distribution across the field.    MODULATED  Between control points, the beam is scanned to create a modulated lateral fluence distribution across the field.    MODULATED_SPEC  Between control points, the beam is scanned to create a modulated lateral fluence distribution across the field. The specific scan mode is defined by Modulated Scan Mode Type (300A,0309)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Modulated Scan Mode Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0309)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Defines the specialization of a modulated scan mode.  Defined Terms:  STATIONARY  The Meterset is delivered while the beam spot is at the specified position.    LEAPING  The delivery of the specified Meterset for the current spot position begins when the spot is at the previous spot position but the spot moves as quickly as possible to the current specified spot position where most of the Meterset is delivered.    LINEAR  The beam spot is delivered with uniform flux while traveling from one position to the next position (continuous).    MIXED  Between control points the beam may be delivered by a combination of STATIONARY, LEAPING or LINEAR modes.    Required if Scan Mode (300A,0308) is MODULATED_SPEC. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Treatment Machine Name"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00B2)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"User-defined name identifying treatment machine to be used for beam delivery. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Manufacturer"},"Tag":{"colspan":"1","rowspan":"1","text":"(0008,0070)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Manufacturer of the equipment to be used for beam delivery."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Institution Name"},"Tag":{"colspan":"1","rowspan":"1","text":"(0008,0080)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Institution where the equipment is located that is to be used for beam delivery."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Institution Address"},"Tag":{"colspan":"1","rowspan":"1","text":"(0008,0081)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Mailing address of the institution where the equipment is located that is to be used for beam delivery."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Institutional Department Name"},"Tag":{"colspan":"1","rowspan":"1","text":"(0008,1040)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Department in the institution where the equipment is located that is to be used for beam delivery."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Manufacturer's Model Name"},"Tag":{"colspan":"1","rowspan":"1","text":"(0008,1090)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Manufacturer's model name of the equipment that is to be used for beam delivery."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Device Serial Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(0018,1000)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Manufacturer's serial number of the equipment that is to be used for beam delivery."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Primary Dosimeter Unit"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00B3)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Measurement unit of machine dosimeter.  Enumerated Values:  MU  Monitor Unit    NP  number of particles"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Referenced Tolerance Table Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,00A0)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely identifies Tolerance Table specified by Tolerance Table Number (300A,0042) within Tolerance Table Sequence in . These tolerances are to be used for verification of treatment machine settings."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Virtual Source-Axis Distances"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,030A)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Distance (in mm) from virtual source position to gantry rotation axis or nominal isocenter position (fixed beam-lines) of the equipment to be used for beam delivery. Specified by a numeric pair - the VSAD in the IEC Gantry X direction followed by the VSAD in the IEC Gantry Y direction. The VSAD is commonly used for designing apertures in contrast to the effective source-axis-distance (ESAD) that is commonly used with the inverse square law for calculating the dose decrease with distance. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Depth Dose Parameters Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0505)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Set of parameters describing the depth dose distribution. Only a single item is permitted in this sequence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Reference Dose Definition"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0512)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Definition of the 100% reference dose level.  Defined Terms:  HIGHEST      MAXIMUM      CENTER      See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Distal Depth"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0502)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Penetration depth in water (mm) of the particle excluding any user-installed range modifying devices, measured at the Distal Depth Fraction (300A,0501). See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Distal Depth Fraction"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0501)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Fraction of the value of dose relative to the 100% level defined by Reference Dose Definition (300A,0512). This determines the Distal Depth (300A,0502). A value of 1.0 refers to 100% of the reference dose level defined by the Reference Dose Definition (300A,0512). See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Nominal Range Modulated Region Depths"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0504)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"The depths of the proximal and distal limits of the range modulated region in water. Contains two values (in mm). The first value defines the depth of the proximal limit. The second value defines the depth of the distal limit. Required if Reference Dose Definition (300A,0512) has the value CENTER. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Nominal Range Modulation Fractions"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0503)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Fractions of the Reference Dose Definition (300A,0512) defining the proximal and distal limits at which the range-modulated region is defined. Contains two values. The first value defines the modulation fraction value at the proximal limit and the second value defines the modulation fraction value at the distal limit. A value of 1.0 refers to the 100% reference dose level as defined in Reference Dose Definition (300A,0512). Required if Nominal Range Modulated Region Depths (300A,0504) is present. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Ion Beam Limiting Device Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,03A4)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of beam limiting device (collimator) jaw or leaf (element) sets. One or more Items are permitted in this Sequence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>RT Beam Limiting Device Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00B8)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Type of beam limiting device (collimator).  Enumerated Values:  X  symmetric jaw pair in IEC X direction    Y  symmetric jaw pair in IEC Y direction    ASYMX  asymmetric jaw pair in IEC X direction    ASYMY  asymmetric pair in IEC Y direction    MLCX  multileaf (multi-element) jaw pair in IEC X direction    MLCY  multileaf (multi-element) jaw pair in IEC Y direction"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Isocenter to Beam Limiting Device Distance"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00BB)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"Isocenter to beam limiting device (collimator) distance (in mm) of the equipment that is to be used for beam delivery. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Number of Leaf/Jaw Pairs"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00BC)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of leaf (element) or jaw pairs (equal to 1 for standard beam limiting device jaws)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Leaf Position Boundaries"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00BE)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Boundaries of beam limiting device (collimator) leaves (in mm) in IEC BEAM LIMITING DEVICE coordinate axis appropriate to RT Beam Limiting Device Type (300A,00B8), i.e., X-axis for MLCY, Y-axis for MLCX. Contains N+1 values, where N is the Number of Leaf/Jaw Pairs (300A,00BC), starting from Leaf (Element) Pair 1. Required if RT Beam Limiting Device Type (300A,00B8) is MLCX or MLCY. May be present otherwise. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Referenced Patient Setup Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,006A)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely identifies Patient Setup to be used for current beam, specified by Patient Setup Number (300A,0182) within Patient Setup Sequence of ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Referenced Reference Image Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,0042)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Reference images used for validation of current beam. One or more Items are permitted in this Sequence."}},{"Attribute Name":{"colspan":"3","rowspan":"1","text":">>Include"},"Tag":{"colspan":"1","rowspan":"1","text":""}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Reference Image Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00C8)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely identifies Reference Image within Referenced Reference Image Sequence (300C,0042)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Treatment Delivery Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00CE)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Delivery Type of treatment.  Defined Terms:  TREATMENT  Normal patient treatment    OPEN_PORTFILM  Portal image acquisition with open field (the source of radiation is specified by Radiation Type (300A,00C6))    TRMT_PORTFILM  Portal image acquisition with treatment port (the source of radiation is specified by Radiation Type (300A,00C6))    CONTINUATION  Continuation of interrupted treatment    SETUP  No treatment beam is applied for this RT Beam. To be used for specifying the gantry, couch, and other machine positions where X-Ray set-up images or measurements shall be taken."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Referenced Dose Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,0080)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Related instances of RT Dose (for grids, isodose curves, and named/unnamed point doses). One or more Items are permitted in this Sequence."}},{"Attribute Name":{"colspan":"3","rowspan":"1","text":">>Include"},"Tag":{"colspan":"1","rowspan":"1","text":"The Referenced Class SOP UID shall be that of the RT Dose SOP Class (1.2.840.10008.5.1.4.1.1.481.2."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Number of Wedges"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00D0)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of wedges associated with current beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Total Wedge Tray Water-Equivalent Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00D7)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Shift of the wedge tray induced on the range of the ion beam as measured in water (in mm)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Ion Wedge Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,03AA)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of treatment wedges. Required if Number of Wedges (300A,00D0) is non-zero. The number of items shall be identical to the value of Number of Wedges (300A,00D0)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Wedge Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00D2)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification number of the Wedges. The value of Wedge Number (300A,00D2) shall be unique within the Beam in which it was created."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Wedge Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00D3)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"Type of wedge (if any) defined for Beam.  Defined Terms:  STANDARD  standard (static) wedge    MOTORIZED  single wedge that can be removed from beam remotely.    PARTIAL_STANDARD  wedge does not extend across the whole field and is operated manually.    PARTIAL_MOTORIZ  wedge does not extend across the whole field and can be removed from beam remotely."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Wedge ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00D4)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User-supplied identifier for Wedge."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Wedge Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00D5)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"Nominal wedge angle (degrees)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Wedge Orientation"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00D8)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"Orientation of wedge, i.e., orientation of IEC WEDGE FILTER coordinate system with respect to the IEC BEAM LIMITING DEVICE coordinate systems (degrees)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Isocenter to Wedge Tray Distance"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00D9)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Isocenter to downstream edge of wedge tray (mm). See"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Number of Compensators"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00E0)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of compensators associated with current Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Total Compensator Tray Water-Equivalent Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02E3)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Water-Equivalent thickness of the compensator tray (in mm) parallel to radiation beam axis."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Ion Range Compensator Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02EA)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of compensators. Required if Number of Compensators (300A,00E0) is non-zero. The number of items shall be identical to the value of Number of Compensators (300A,00E0)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Description"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02EB)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User defined description for the compensator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00E4)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification number of the Compensator. The value of Compensator Number (300A,00E4) shall be unique within the Beam in which it is created."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Material ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00E1)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"User-supplied identifier for material used to manufacture Compensator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00E5)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User-supplied identifier for the compensator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Isocenter to Compensator Tray Distance"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02E4)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Isocenter to compensator tray attachment edge distance (in mm) for current range compensator. Required if Compensator Mounting Position (300A,02E1) is not DOUBLE_SIDED. See"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Divergence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02E0)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Indicates presence or absence of geometrical divergence of the range compensator.  Enumerated Values:  PRESENT  the range compensator is shaped according to the beam geometrical divergence.    ABSENT  the range compensator is not shaped according to the beam geometrical divergence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Mounting Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02E1)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Indicates on which side of the Compensator Tray the compensator is mounted.  Enumerated Values:  PATIENT_SIDE  the Compensator is mounted on the side of the Compensator Tray that is towards the patient.    SOURCE_SIDE  the Compensator is mounted on the side of the Compensator Tray that is towards the radiation source.    DOUBLE_SIDED  the Compensator has a shaped (i.e., non-flat) surface on both sides of the Compensator Tray."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Rows"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00E7)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of rows in the range compensator. A row is defined to be in the X direction of the IEC Beam Limiting Device Coordinate system."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Columns"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00E8)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of columns in the range compensator. A column is defined to be in the Y direction of the IEC Beam Limiting Device Coordinate system."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Pixel Spacing"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00E9)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Physical distance (in mm) between the center of each pixel projected onto machine isocentric plane. Specified by a numeric pair - adjacent row spacing followed by adjacent column spacing. See  for further explanation of the value order."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00EA)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"The x and y coordinates of the upper left hand corner (first pixel transmitted) of the range compensator, projected onto the machine isocentric plane in the IEC BEAM LIMITING DEVICE coordinate system (mm)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Column Offset"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02E5)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"The offset distance (in mm) applied to the x coordinate of Compensator Position (300A,00EA) for even numbered rows. Required if the compensator pattern is hexagonal."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Thickness Data"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00EC)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"A data stream of the pixel samples that comprise the range compensator, expressed as physical thickness (in mm), either parallel to radiation beam axis if Compensator Divergence (300A,02E0) equals ABSENT, or divergent according to the beam geometrical divergence if Compensator Divergence (300A,02E0) equals PRESENT. The order of pixels sent is left to right, top to bottom (upper left pixel, followed by the remainder of row 1, followed by the remainder of the rows)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Isocenter to Compensator Distances"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02E6)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"A data stream of the pixel samples that comprise the distance from the isocenter to the compensator surface closest to the radiation source (in mm). The order of pixels sent is left to right, top to bottom (upper left pixel, followed by the remainder of row 1, followed by the remainder of the rows). Required if Material ID (300A,00E1) is non-zero length, and Compensator Mounting Position (300A,02E1) is DOUBLE_SIDED. See  and ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Relative Stopping Power Ratio"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02E7)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Compensator Linear Stopping Power Ratio, relative to water, at the beam energy specified by the Nominal Beam Energy (300A,0114) of the first Control Point of the Ion Control Point Sequence (300A,03A8)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Compensator Milling Tool Diameter"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,02E8)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"The diameter (in mm) of the milling tool to be used to create the compensator. The diameter is expressed as the actual physical size and not a projected size at isocenter."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Number of Boli"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00ED)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of boli associated with current Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Referenced Bolus Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,00B0)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of boli associated with Beam. Required if Number of Boli (300A,00ED) is non-zero. The number of items shall be identical to the value of Number of Boli (300A,00ED)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Referenced ROI Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(3006,0084)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely identifies ROI representing the Bolus specified by ROI Number (3006,0022) in Structure Set ROI Sequence (3006,0020) in  within RT Structure Set in Referenced Structure Set Sequence (300C,0060) in ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Number of Blocks"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F0)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of shielding blocks associated with Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Total Block Tray Water-Equivalent Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F3)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Water-Equivalent thickness of the block tray (in mm) parallel to radiation beam axis."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Ion Block Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,03A6)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of blocks associated with Beam. Required if Number of Blocks (300A,00F0) is non-zero. The number of items shall be identical to the value of Number of Blocks (300A,00F0)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Tray ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F5)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User-supplied identifier for block tray."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader. Shall not be present if Block Slab Sequence (300A,0441) is present within the same item of Ion Block Sequence (300A,03A6) or when the Block Type (300A,00F8) has a value of APERTURE and Block Slab Sequence (300A,0441) is present in another item having this value."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Isocenter to Block Tray Distance"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F7)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Isocenter to downstream edge of block tray (mm). See"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F8)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Type of block. See .  Enumerated Values:  SHIELDING  blocking material is inside contour    APERTURE  blocking material is outside contour"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Divergence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00FA)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Indicates presence or otherwise of geometrical divergence.  Enumerated Values:  PRESENT  block edges are shaped for beam divergence    ABSENT  block edges are not shaped for beam divergence"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Mounting Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00FB)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Indicates on which side of the Block Tray the block is mounted.  Enumerated Values:  PATIENT_SIDE  the block is mounted on the side of the Block Tray that is towards the patient    SOURCE_SIDE  the block is mounted on the side of the Block Tray that is towards the radiation source"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00FC)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification number of the Block. The value of Block Number (300A,00FC) shall be unique within the Beam in which it is created."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Name"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00FE)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User-defined name for block."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Material ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00E1)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"User-supplied identifier for material used to manufacture Block."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0100)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Physical thickness of block (in mm) parallel to radiation beam axis. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Number of Points"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0104)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of (x,y) pairs defining the block edge."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Data"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0106)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"A data stream of (x,y) pairs that comprise the block edge. The number of pairs shall be equal to Block Number of Points (300A,0104), and the vertices shall be interpreted as a closed polygon. Coordinates are projected onto the machine isocentric plane in the IEC BEAM LIMITING DEVICE coordinate system (mm)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Number of Block Slab Items"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0440)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Number of Block Slabs comprising the Block. Value shall be greater than 1."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Block Slab Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0441)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of slab(s) that comprise the block. Required if Number of Block Slab Items (300A,0440) is present. Shall be present only in the first Item of Ion Block Sequence (300A,03A6) if multiple Items are present where Block Type (300A,00F8) has a value of APERTURE. If this Sequence is present, Accessory Code (300A,00F9) shall not be present within the same Item of Ion Block Sequence (300A,03A6). The number of Items included in this Sequence shall equal the value of Number of Block Slab Items (300A,0440)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Block Slab Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0443)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification number of the Block Slab.  The value shall start at 1, and increase monotonically by 1.  The number indicates the order of the slabs with respect to the source, where number 1 corresponds to the slab nearest to the source."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Block Slab Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0442)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Physical thickness of block slab (in mm) parallel to radiation beam axis. The sum of the Block Slab Thickness (300A,0442) values of all Items of this Sequence shall be equal to the Block Thickness (300A,0100) of the block."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Machine-readable identifier for this accessory."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Snout Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,030C)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of Snouts associated with Beam. Only a single item is permitted in this Sequence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Snout ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,030F)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"User or machine supplied identifier for Snout."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Applicator Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0107)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of Applicators associated with Beam. Only a single item is permitted in this Sequence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Applicator ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0108)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"User or machine supplied identifier for Applicator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Applicator Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0109)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Type of applicator.  Defined Terms:  ION_SQUARE  square ion applicator    ION_RECT  rectangular ion applicator    ION_CIRC  circular ion applicator    ION_SHORT  short ion applicator    ION_OPEN  open (dummy) ion applicator    INTRAOPERATIVE  intraoperative (custom) applicator    STEREOTACTIC  stereotactic applicator"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Applicator Description"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,010A)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User-defined description for Applicator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">General Accessory Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0420)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Introduces a Sequence of General Accessories associated with this Beam. One or more Items are permitted in this Sequence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>General Accessory Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0424)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification Number of the General Accessory. The value shall be unique within the sequence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>General Accessory ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0421)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"User or machine supplied identifier for General Accessory."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>General Accessory Description"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0422)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User supplied description of General Accessory."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>General Accessory Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0423)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Specifies the type of accessory.  Defined Terms:  GRATICULE  Accessory tray with a radio-opaque grid    IMAGE_DETECTOR  Image acquisition device positioned in the beam line    RETICLE  Accessory tray with radio-transparent markers or grid"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Machine-readable identifier for this accessory"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Source to General Accessory Distance"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0425)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Radiation source to general accessory distance (in mm) for current accessory."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Number of Range Shifters"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0312)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of range shifters associated with current beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Range Shifter Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0314)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of range shifters associated with Beam. Required if Number of Range Shifters (300A,0312) is non-zero. The number of items shall be identical to the value of Number of Range Shifters (300A,0312)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Shifter Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0316)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification number of the Range Shifter. The value of Range Shifter Number (300A,0316) shall be unique within the Beam in which it is created."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Shifter ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0318)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"User or machine supplied identifier for Range Shifter."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Shifter Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0320)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Type of Range Shifter.  Defined Terms:  ANALOG  Device is variable thickness and is composed of opposing sliding wedges, water column or similar mechanism.    BINARY  Device is composed of different thickness materials that can be moved in or out of the beam in various stepped combinations."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Shifter Description"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0322)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User defined description of Range Shifter."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Number of Lateral Spreading Devices"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0330)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of lateral spreading devices associated with current beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Lateral Spreading Device Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0332)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of lateral spreading devices associated with Beam. Required if Number of Lateral Spreading Devices (300A,0330) is non-zero. The number of items shall be identical to the value of Number of Lateral Spreading Devices (300A,0330)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Lateral Spreading Device Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0334)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification number of the Lateral Spreading Device. The value of Lateral Spreading Device Number (300A,0334) shall be unique within the Beam in which it is created."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Lateral Spreading Device ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0336)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"User or machine supplied identifier for Lateral Spreading Device."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Lateral Spreading Device Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0338)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Type of Lateral Spreading Device.  Defined Terms:  SCATTERER  metal placed into the beam path to scatter charged particles laterally.    MAGNET  nozzle configuration of magnet devices to expand beam laterally."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Lateral Spreading Device Description"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,033A)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User-defined description for lateral spreading device."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Number of Range Modulators"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0340)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of range modulators associated with current beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Range Modulator Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0342)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of range modulators associated with Beam. Required if Number of Range Modulators (300A,0340) is non-zero. The number of items shall be identical to the value of Number of Range Modulators (300A,0340)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Modulator Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0344)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Identification number of the Range Modulator. The value of Range Modulator Number (300A,0344) shall be unique within the Beam in which it is created."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Modulator ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0346)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"User or machine supplied identifier for Range Modulator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Accessory Code"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00F9)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"An accessory identifier to be read by a device such as a bar code reader."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Modulator Type"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0348)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Type of Range Modulator.  Defined Terms:  FIXED  fixed modulation width and weights using ridge filter or constant speed wheel with constant beam current    WHL_FIXEDWEIGHTS  selected wheel/track (Range Modulator ID) is spinning at constant speed. Modulation width is adjusted by switching constant beam current on and off at wheel steps indicated by Range Modulator Gating Values.    WHL_MODWEIGHTS  selected wheel/track (Range Modulator ID) is spinning at constant speed. Weight per wheel step is adjusted by modulating beam current according to selected Beam Current Modulation ID (300A,034C).    Only one item in the Range Modulator Sequence (300A,0342) can have a Range Modulator Type (300A,0348) of WHL_MODWEIGHTS."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Modulator Description"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,034A)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"User-defined description of Range Modulator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Beam Current Modulation ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,034C)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"User-supplied identifier for the beam current modulation pattern. Required if Range Modulator Type (300A,0348) is WHL_MODWEIGHTS"}},{"Attribute Name":{"colspan":"3","rowspan":"1","text":">Include"},"Tag":{"colspan":"1","rowspan":"1","text":""}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Fixation Light Azimuthal Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0356)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Azimuthal angle (degrees) of the fixation light coordinate around IEC BEAM LIMITING DEVICE Y-axis. Used for eye treatments. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Fixation Light Polar Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0358)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Polar angle (degrees) of the fixation light coordinate. Used for eye treatments. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Fixation Eye"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0150)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"The eye used for fixation.   L  left eye    R  right eye"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Final Cumulative Meterset Weight"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,010E)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Value of Cumulative Meterset Weight (300A,0134) for final Control Point in Ion Control Point Sequence (300A,03A8). Required if Cumulative Meterset Weight is non-null in Control Points specified within Ion Control Point Sequence. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Number of Control Points"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0110)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Number of control points in Beam. Value shall be greater than or equal to 2."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">Ion Control Point Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,03A8)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of machine configurations describing Ion treatment beam. The number of items shall be identical to the value of Number of Control Points (300A,0110). See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Control Point Index"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0112)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Index of current Control Point, starting at 0 for first Control Point."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Cumulative Meterset Weight"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0134)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"Cumulative weight to current control point. Cumulative Meterset Weight for the first item in Control Point Sequence shall always be zero. Cumulative Meterset Weight for the final item in Ion Control Point Sequence shall always be equal to Final Cumulative Meterset Weight."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Referenced Dose Reference Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,0050)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Introduces a sequence of Dose References for current Beam. One or more Items are permitted in this Sequence."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Referenced Dose Reference Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,0051)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely identifies Dose Reference specified by Dose Reference Number (300A,0012) in Dose Reference Sequence (300A,0010) in ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Cumulative Dose Reference Coefficient"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,010C)"},"Type":{"colspan":"1","rowspan":"1","text":"2"},"Description":{"colspan":"1","rowspan":"1","text":"Coefficient used to calculate cumulative dose contribution from this Beam to the referenced Dose Reference at the current Control Point."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Nominal Beam Energy"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0114)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Nominal Beam Energy at control point in MeV per nucleon. Defined at nozzle entrance before all Beam Modifiers. Required for first item of Control Point Sequence, or if Nominal Beam Energy changes during Beam, and KVP (0018,0060) is not present."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>KVP"},"Tag":{"colspan":"1","rowspan":"1","text":"(0018,0060)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Peak kilo voltage output of the setup X-Ray generator to be used. Required for first item of Control Point Sequence, or if kVp changes during setup, and Nominal Beam Energy (300A,0114) is not present."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Meterset Rate"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,035A)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Specifies the speed of delivery of the specified dose in units specified by Primary Dosimeter Unit (300A,00B3) per minute."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Ion Wedge Position Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,03AC)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of Wedge positions for current control point. Required for first item of Ion Control Point Sequence if Number of Wedges (300A,00D0) is non-zero, and in subsequent control points if Wedge Position (300A,0118) or Wedge Thin Edge Position (300A,00DB) changes during beam. The number of items shall be identical to the value of Number of Wedges (300A,00D0)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Referenced Wedge Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,00C0)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely references Wedge described by Wedge Number (300A,00D2) in Wedge Sequence (300A,00D1)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Wedge Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0118)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Position of Wedge at current Control Point.  Enumerated Values:  IN      OUT"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Wedge Thin Edge Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,00DB)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Closest distance from the central axis of the beam along a wedge axis to the thin edge as projected to the machine isocentric plane (mm). Value is positive is the wedge does not cover the central axis, negative if it does. Required if Wedge Type (300A,00D3) of the wedge referenced by Referenced Wedge Number (300C,00C0) is PARTIAL_STANDARD or PARTIAL_MOTORIZ. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Shifter Settings Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0360)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of Range Shifter settings for the current control point. One or more Items shall be included in this Sequence. Required for first item of Control Point Sequence if Number of Range Shifters (300A,0312) is non-zero, or if Range Shifter Setting (300A,0362) changes during Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Referenced Range Shifter Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,0100)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely references Range Shifter described by Range Shifter Number (300A,0316) in Range Shifter Sequence (300A,0314)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Range Shifter Setting"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0362)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Machine specific setting attribute for the range shifter. The specific encoding of this value should be documented in a Conformance Statement. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Isocenter to Range Shifter Distance"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0364)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Isocenter to downstream edge of range shifter (mm) at current control point. See"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Range Shifter Water Equivalent Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0366)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Water equivalent thickness (in mm) of the range shifter at the central axis for the beam energy incident upon the device."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Lateral Spreading Device Settings Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0370)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of Lateral Spreading Device settings for the current control point. One or more Items shall be included in this Sequence. Required for first item of Control Point Sequence if Number of Lateral Spreading Devices (300A,0330) is non-zero, or if Lateral Spreading Device Setting (300A,0372) changes during Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Referenced Lateral Spreading Device Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,0102)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely references Lateral Spreading Device described by Lateral Spreading Device Number (300A,0334) in Lateral Spreading Device Sequence (300A,0332)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Lateral Spreading Device Setting"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0372)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Machine specific setting attribute for the lateral spreading device. The specific encoding of this value should be documented in a Conformance Statement. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Isocenter to Lateral Spreading Device Distance"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0374)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Isocenter to downstream edge of Lateral Spreading Device (mm) at current control point. See"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Lateral Spreading Device Water Equivalent Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,033C)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Water equivalent thickness (in mm) of the lateral spreading device at the central axis for the beam energy incident upon the device."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Range Modulator Settings Sequence"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0380)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Sequence of Range Modulator Settings for current control point. One or more Items shall be included in this Sequence. Required for first item of Control Point Sequence if Number of Range Modulators (300A,0340) is non-zero, or if Range Modulator Setting changes during Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Referenced Range Modulator Number"},"Tag":{"colspan":"1","rowspan":"1","text":"(300C,0104)"},"Type":{"colspan":"1","rowspan":"1","text":"1"},"Description":{"colspan":"1","rowspan":"1","text":"Uniquely references Range Modulator described by Range Modulator Number (300A,0344) in Range Modulator Sequence (300A,0342)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Range Modulator Gating Start Value"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0382)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Start position defines the range modulator position at which the beam is switched on. Required if Range Modulator Type (300A,0348) of the range modulator referenced by Referenced Range Modulator Number (300C,0104) is WHL_MODWEIGHTS or WHL_FIXEDWEIGHTS"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Range Modulator Gating Stop Value"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0384)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Stop position defines the range modulator position at which the beam is switched off. Required if Range Modulator Type (300A,0348) of the range modulator referenced by Referenced Range Modulator Number (300C,0104) is WHL_MODWEIGHTS or WHL_FIXEDWEIGHTS"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Range Modulator Gating Start Water Equivalent Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0386)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"If Range Modulator Type (300A,0348) is WHL_MODWEIGHTS or WHL_FIXEDWEIGHTS: Water equivalent thickness (in mm) of the range modulator at the position specified by Range Modulator Gating Start Value (300A,0382). If Range Modulator Type (300A,0348) is FIXED: Minimum water equivalent thickness (in mm) of the range modulator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Range Modulator Gating Stop Water Equivalent Thickness"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0388)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"If Range Modulator Type (300A,0348) is WHL_MODWEIGHTS or WHL_FIXEDWEIGHTS: Water equivalent thickness (in mm) of the range modulator at the position specified by Range Modulator Gating Stop Value (300A,0384). If Range Modulator Type (300A,0348) is FIXED: Maximum water equivalent thickness (in mm) of the range modulator."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>>Isocenter to Range Modulator Distance"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,038A)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Isocenter to downstream edge of range modulator (mm) at current control point. See"}},{"Attribute Name":{"colspan":"3","rowspan":"1","text":">>Include"},"Tag":{"colspan":"1","rowspan":"1","text":""}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Gantry Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,011E)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Gantry angle of radiation source, i.e., orientation of IEC GANTRY coordinate system with respect to IEC FIXED REFERENCE coordinate system (degrees). Required for first item of Control Point Sequence, or if Gantry Angle changes during Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Gantry Rotation Direction"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,011F)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Direction of Gantry Rotation when viewing gantry from isocenter, for segment following Control Point. Required for first item of Control Point Sequence, or if Gantry Rotation Direction changes during Beam. See .  Enumerated Values:  CW  clockwise    CC  counter-clockwise    NONE  no rotation"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Gantry Pitch Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,014A)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Gantry Pitch Angle of the radiation source, i.e., the rotation of the IEC GANTRY coordinate system about the X-axis of the IEC GANTRY coordinate system (degrees). Required for first item of Control Point Sequence, or if Gantry Pitch Rotation Angle changes during Beam. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Gantry Pitch Rotation Direction"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,014C)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Direction of Gantry Pitch Angle when viewing along the positive X-axis of the IEC GANTRY coordinate system, for segment following Control Point. Required for first item of Control Point Sequence, or if Gantry Pitch Rotation Direction changes during Beam. See  and .  Enumerated Values:  CW  clockwise    CC  counter-clockwise    NONE  no rotation"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Beam Limiting Device Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0120)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Beam Limiting Device angle, i.e., orientation of IEC BEAM LIMITING DEVICE coordinate system with respect to IEC GANTRY coordinate system (degrees). Required for first item of Control Point Sequence, or if Beam Limiting Device Angle changes during Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Beam Limiting Device Rotation Direction"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0121)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Direction of Beam Limiting Device Rotation when viewing beam limiting device (collimator) from radiation source, for segment following Control Point. Required for first item of Control Point Sequence, or if Beam Limiting Device Rotation Direction changes during Beam. See .  Enumerated Values:  CW  clockwise    CC  counter-clockwise    NONE  no rotation"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Scan Spot Tune ID"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0390)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"User-supplied or machine code identifier for machine configuration to produce beam spot. This may be the nominal spot size or some other machine specific value. Required if Scan Mode (300A,0308) is MODULATED or MODULATED_SPEC."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Scan Spot Reordering Allowed"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0395)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Indicates whether the spot delivery order shall remain the same as planned order.  Enumerated Values:  ALLOWED  The delivery device may deliver the spots in any order    NOT ALLOWED  The delivery device shall not change the order of the spots within the map and must deliver them in the prescribed order."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Number of Scan Spot Positions"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0392)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Number of spot positions used to specify scanning pattern for current segment beginning at control point. Required if Scan Mode (300A,0308) is MODULATED or MODULATED_SPEC."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Scan Spot Position Map"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0394)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"The x and y coordinates of the scan spots are defined as projected onto the machine isocentric plane in the IEC GANTRY coordinate system (mm). Required if Scan Mode (300A,0308) is MODULATED or MODULATED_SPEC. Contains 2N values where N is the Number of Scan Spot Positions (300A,0392). See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Scan Spot Meterset Weights"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0396)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"A data set of Meterset weights corresponding to scan spot positions. The order of weights matches the positions in Scan Spot Positions (300A,0394). The sum contained in all Meterset weights shall match the difference of the cumulative Meterset weight of the current control point to the following control point. Required if Scan Mode (300A,0308) is MODULATED or MODULATED_SPEC. See"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Scanning Spot Size"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0398)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"The Scanning Spot Size as calculated using the Full Width Half Maximum (FWHM). Specified by a numeric pair - the size measured in air at isocenter in IEC GANTRY X direction followed by the size in the IEC GANTRY Y direction (mm)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Number of Paintings"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,039A)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"The number of times the scan pattern given by Scan Spot Position Map (300A,0394) and Scan Spot Meterset Weights (300A,0396) shall be applied at the current control point. To obtain the Meterset weight per painting, the values in the Scan Spot Meterset Weights (300A,0396) should be divided by the value of this attribute. Required if Scan Mode (300A,0308) is MODULATED or MODULATED_SPEC."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Patient Support Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0122)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Patient Support angle, i.e., orientation of IEC PATIENT SUPPORT (turntable) coordinate system with respect to IEC FIXED REFERENCE coordinate system (degrees). Required for first item of Control Point Sequence, or if Patient Support Angle changes during Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Patient Support Rotation Direction"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0123)"},"Type":{"colspan":"1","rowspan":"1","text":"1C"},"Description":{"colspan":"1","rowspan":"1","text":"Direction of Patient Support Rotation when viewing table from above, for segment following Control Point. Required for first item of Control Point Sequence, or if Patient Support Rotation Direction changes during Beam. See .  Enumerated Values:  CW  clockwise    CC  counter-clockwise    NONE  no rotation"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Table Top Pitch Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0140)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Table Top Pitch Angle, i.e., the rotation of the IEC TABLE TOP coordinate system about the X-axis of the IEC TABLE TOP coordinate system (degrees). Required for first item of Control Point Sequence, or if Table Top Pitch Angle changes during Beam. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Table Top Pitch Rotation Direction"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0142)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Direction of Table Top Pitch Rotation when viewing the table along the positive X-axis of the IEC TABLE TOP coordinate system, for segment following Control Point. Required for first item of Control Point Sequence, or if Table Top Pitch Rotation Direction changes during Beam. See  and .  Enumerated Values:  CW  clockwise    CC  counter-clockwise    NONE  no rotation"}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Table Top Roll Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0144)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Table Top Roll Angle, i.e., the rotation of the IEC TABLE TOP coordinate system about the Y-axis of the IEC TABLE TOP coordinate system (degrees). Required for first item of Control Point Sequence, or if Table Top Roll Angle changes during Beam. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Table Top Roll Rotation Direction"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0146)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Direction of Table Top Roll Rotation when viewing the table along the positive Y-axis of the IEC TABLE TOP coordinate system, for segment following Control Point. Required for first item of Control Point Sequence, or if Table Top Roll Rotation Direction changes during Beam. See  and .  Enumerated Values:  CW  clockwise    CC  counter-clockwise    NONE  no rotation."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Head Fixation Angle"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0148)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Angle (in degrees) of the head fixation for eye treatments with respect to the Table Top Pitch Angle (300A,0140) coordinate system. Positive head fixation angle is the same direction as positive Table Top pitch. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Chair Head Frame Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0151)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"A device-specific value that specifies the relationship between the chair in which the patient is sitting and the head frame in which their head is fixed. It shall be expressed as a distance in mm, such that positive is towards the patient's head away from the seat.  This value is not intended to be used for geometric calculations, however, for the same device, the relative distance is meaningful.  Typically used for eye treatments."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Table Top Vertical Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0128)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Table Top Vertical position in IEC TABLE TOP coordinate system (mm). Required for first item of Control Point Sequence, or if Table Top Vertical Position changes during Beam. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Table Top Longitudinal Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0129)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Table Top Longitudinal position in IEC TABLE TOP coordinate system (mm). Required for first item of Control Point Sequence, or if Table Top Longitudinal Position changes during Beam. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Table Top Lateral Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,012A)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Table Top Lateral position in IEC TABLE TOP coordinate system (mm). Required for first item of Control Point Sequence, or if Table Top Lateral Position changes during Beam. See ."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Snout Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,030D)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Axial position of the snout (in mm) measured from isocenter to the downstream side of the snout (without consideration of variable length elements such as blocks, MLC and/or compensators). Required for first item in Control Point Sequence, or if Snout Position changes during Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Isocenter Position"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,012C)"},"Type":{"colspan":"1","rowspan":"1","text":"2C"},"Description":{"colspan":"1","rowspan":"1","text":"Isocenter coordinates (x,y,z) in the patient based coordinate system described in  (mm). Required for first item of Segment Control Point Sequence, or if Segment Isocenter Position changes during Beam."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>Surface Entry Point"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,012E)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"Patient surface entry point coordinates (x,y,z), along the central axis of the beam, in the patient based coordinate system described in  (mm)."}},{"Attribute Name":{"colspan":"1","rowspan":"1","text":">>External Contour Entry Point"},"Tag":{"colspan":"1","rowspan":"1","text":"(300A,0133)"},"Type":{"colspan":"1","rowspan":"1","text":"3"},"Description":{"colspan":"1","rowspan":"1","text":"External Contour entry point coordinates (x,y,z) in the patient based coordinate system described in  (mm). See ."}}];